      <BottomNavigationAction
        icon={<GitHubIcon />}
        className={classes.root}
        target="_blank"
        href="https://github.com/TylerPMatthews"
      />
      <BottomNavigationAction
        icon={<LinkedInIcon />}
        className={classes.root}
        target="_blank"
        href="https://www.linkedin.com/in/ðŸ–¥-tyler-matthewsðŸ“±-065a411b3/"
      />
      <BottomNavigationAction
        icon={<AccountBoxIcon />}
        className={classes.root}
        target="_blank"
        href="https://github.com/TylerPMatthews"
      />
    </BottomNavigation>
  );
};
export default Footer;
